Access to these quotas shall, however, be reserved for products:
- accompanied by a certificate of authenticity recognized by the relevant Community authorities and conforming to one of the models in the annex of  Regulation (EC) no 32/2000;
- which bear, at the beginning and end of each piece, a stamp approved by the said authorities or, by way of derogation, a seal approved by the authorities of the country of manufacture and fixed to each piece; 
- which are transported directly to the Community from the country of manufacture (Regulation (EC) no 32/2000, OJ L 5).

The import of rough diamonds into the European Union shall be prohibited unless all of the following conditions are fulfilled:
(a) the rough diamonds are accompanied by a Kimberley Process certificate validated by the competent authority of a Participant (member-country of the Kimberley process);
(b) the rough diamonds are contained in tamper-resistant containers, and the seals applied at export by that Participant are not broken;
(c) the Kimberley Process certificate clearly identifies the consignment to which it refers.
The shipment shall be submitted for verification to a "Community authority" as per Art. 4 of (EC) Regulation 2368/2002 (see updated list on <a href="http://eur-lex.europa.eu/LexUriServ/LexUriServ.do?uri=CONSLEG:2002R2368:20081218:EN:PDF"> http://eur-lex.europa.eu/LexUriServ/LexUriServ.do?uri=CONSLEG:2002R2368:20081218:EN:PDF</a>).

The export from the European Union of rough diamonds shall be prohibited unless both of the following conditions are fulfilled:
(a) the rough diamonds are accompanied by a corresponding Kimberley Process certificate issued and validated by a Community authority (see updated list on http://eur-lex.europa.eu/LexUriServ/LexUriServ.do?uri=CONSLEG:2002R2368:20081218:EN:PDF);
(b) the rough diamonds are contained in tamper-resistant sealed containers.

