(2) The following declaration: 'I, the undersigned, certify that the (volume) of monosodium glutamate sold for export to the European Union covered by this invoice was manufactured by (company name and address) (TARIC additional code) in Indonesia. I declare that the information provided in this invoice is complete and correct';
