The following shall be considered hand-made products:
(a) cottage industry products made entirely by hand;
(b) cottage industry products which have the character of products made by hand;
(c) garments or other textile products obtained manually from fabrics woven on looms operated solely by hand or foot and essentially sewn by hand or sewn by sewing-machines operated solely by hand or foot.

Heat exchangers as follows and specially designed components therefor:
a. Plate-fin heat exchangers with a surface/volume ratio greater than 500 m2/m3, specially designed for pre-cooling of natural gas;
b. Coil-wound heat exchangers specially designed for liquefaction or sub-cooling of natural gas.

Tubes with an outer diameter of 0,2 m or more and made from any of the following materials:
a. Stainless steels with 23% chromium or more by weight;
b. Stainless steels and nickel bases alloys with a "Pitting resistance equivalent" number higher than 33 (2.A.13., Annex VI, Regulation No 961/2010 - OJ L 281, 27.10.2010).

Catalysts for the cracking and conversion of hydrocarbons as follows:
a. Single metal (platinum group) on alumina type or on zeolite, specially designed for catalytic reforming process;
b. Mixed metal species (platinum in combination with other noble metals) on alumina type or on zeolite, specially designed for catalytic reforming process;
c. Cobalt and nickel catalysts doped with molybdenum on alumina type or on zeolite, specially designed for catalytic desulphurisation process;
d. Palladium, nickel, chromium and tungsten catalysts on alumina type or on zeolite, specially designed for catalytic hydrocracking process
 (2.C.4., Annex VI, Regulation No 961/2010 - OJ L 281, 27.10.2010).

The frequency of physical checks carried out by the Member States shall be significantly reduced provided that the consignments are accompanied by the following documents:
(a) the results of sampling and analysis performed by a USDA approved laboratory carried out in accordance with or equivalent to the provisions of Commission Regulation (EC) No 401/2006 of 23 February 2006 laying down the methods of sampling and analysis for the official control of mycotoxins in foodstuffs (TARIC certificate code C692); 
(b) a certificate in accordance with the model set out in the Annex II of Commission Implementing Regulation (EU) 2015/949, completed, signed and verified by an authorised representative of the USDA for foodstuffs from the United States of America (TARIC certificate code C684).
